import rectangle from '../../img/rectangle-7-11.png';
import rectanglePanel from '../../img/rectangle-9.svg';
import polygon3 from '../../img/polygon-3.svg';
import likeButton from '../../img/icon-3.svg';
import checkButton from '../../img/vector-81.svg';

export default function Locations() {
    return (
        <div className="flex flex-col items-start gap-3 relative self-stretch w-full">
            <div className="text-sm font-semibold text-[#7a7a7a] mt-[-1px]">
                800sqft with View
            </div>
            <div className="flex flex-col items-center justify-center gap-4 relative w-full">
                <PropertyListing />
                <LoadmoreButton />
            </div>
        </div>
    );
}

function PropertyListing({
    propertyName = 'Property name', 
    address = '(3806 W 20th Ave, Kennewick, WA 99338)',
    suggestedRentValue = 1234,
    rent = 123,
    floorNumber = 10,
    stories = 6,
    avgUnitSize = '741 SF',
    views = 20,
    showings = 20,
    date = '12.12.2024',
    parking = '-',
    type = 'Apartments - All',
    distance = '-'
}) {
    return (
        <div className="relative w-[1013px] h-[186px]">
            <img
                className="absolute w-[798px] h-[186px] top-0 left-[215px]"
                alt="Rectangle Panel"
                src={rectanglePanel}
            />
            <img
                className="absolute w-[343px] h-[186px] top-0 left-0 object-cover"
                alt="Rectangle"
                src={rectangle}
            />
            <div className="absolute top-[58px] left-[806px] flex flex-col gap-4">
                <div className="relative w-[186px] h-[41px] rounded-[23.5px] border border-black">
                    <div className="absolute top-4 left-[13px] text-xs font-semibold text-black">
                        View Rental Comparisons
                    </div>
                </div>
                <div className="relative h-[47px] w-[131px]">
                    <div className="absolute text-xl font-bold text-orange top-0 left-0">
                        {suggestedRentValue}
                    </div>
                    <div className="absolute text-base text-[#918f8f] top-[27px] left-0">
                        Suggested Rent
                    </div>
                </div>
            </div>
            <div className="absolute top-0 left-[324px] w-[21px] h-[59px]">
                <div className="bg-[#ff914d] rounded-[1.13px_8.48px_9.61px_9.61px] h-[59px]">
                    <div className="absolute text-white text-[7px] rotate-[90deg] top-[25px] left-[-3px]">
                        Active Listing
                    </div>
                </div>
            </div>
            <div className="absolute top-[169px] left-[92px] w-9 h-[7px] bg-[#2a2a3399] rounded-full">
                <div className="inline-flex items-center gap-[1.7px] relative top-0.5 left-0.5">
                    {[...Array(5)].map((_, idx) => (
                        <div key={idx} className={`w-[3.39px] h-[3.39px] rounded-[1.7px] bg-white ${idx > 0 ? 'opacity-60' : ''}`} />
                    ))}
                </div>
            </div>
            <div className="absolute top-[7px] left-[3px] w-[26px] h-[26px] bg-white rounded-[3px] border border-[#00000042] shadow-[0px_2.62px_13.1px_#0000001f]">
                <img
                    className="absolute top-2 left-[7px] w-[11px] h-[9px]"
                    alt="Check Button"
                    src={checkButton}
                />
            </div>
            <CardValues 
                propertyName={propertyName}
                address={address}
                suggestedRentValue={suggestedRentValue}
                rent={rent}
                floorNumber={floorNumber}
                stories={stories}
                avgUnitSize={avgUnitSize}
                views={views}
                showings={showings}
                date={date}
                parking={parking}
                type={type}
                distance={distance}
            />
            <img
                className="absolute w-[15px] h-[13px] top-16 left-[843px]"
                alt="Polygon"
                src={polygon3}
            />
        </div>
    );
}

function CardValues({
    propertyName, 
    address,
    suggestedRentValue,
    rent,
    floorNumber,
    stories,
    avgUnitSize,
    views,
    showings,
    date,
    parking,
    type,
    distance
}) {
    const segmentsData = [
        { val: `$1,075`, label: 'Rent/SqFt' },
        { val: rent, label: 'Rent' },
        { val: floorNumber, label: 'Floor Number' },
        { val: stories, label: 'Stories' },
        { val: avgUnitSize, label: 'Avg. Unit Size' },
        { val: views, label: 'No. Viewed' },
        { val: showings, label: 'No. Showings' },
        { val: date, label: 'Lease Expiry' },
        { val: parking, label: 'Parking' },
        { val: type, label: 'Type' },
        { val: distance, label: 'Distance to Transit' }
    ];

    return (
        <div className="absolute w-[464px] h-[157px] top-[23px] left-[372px]">
            <p className="text-xs font-normal text-[#2a2a33] mt-[25px]">
                Amenities - View, Balcony, Garage, Dishwasher, Fitness Center
            </p>
            <p className="text-xl font-normal text-black">
                <span className="font-bold">{propertyName}</span>
                <span className="font-semibold text-sm"> {address}</span>
            </p>
            <div className="w-[460px] h-24 mt-[61px]">
                <div className="flex flex-wrap gap-[21px_13px]">
                    {segmentsData.map(({ val, label }, idx) => (
                        <React.Fragment key={idx}>
                            <Segments v1={val} v2={label} />
                            {idx < segmentsData.length - 1 && <img className="w-px h-[30px]" alt="Line" src="/img/line-7.svg" />}
                        </React.Fragment>
                    ))}
                </div>
            </div>
        </div>
    );
}

function Segments({ v1, v2 }) {
    return (
        <div className="flex flex-col w-[60px] items-start gap-[1.89px]">
            <ValuesBold val={v1} />
            <Values val={v2} />
        </div>
    );
}

function LoadmoreButton() {
    return (
        <div className="w-[124px] h-[47px]">
            <div className="w-[122px] h-[47px] bg-black rounded-[23.5px] flex items-center justify-center">
                <div className="text-xs font-semibold text-white text-center">
                    Load More
                </div>
            </div>
        </div>
    );
}

function ValuesBold({ val }) {
    return (
        <div className="text-xs font-bold text-black">
            {val}
        </div>
    );
}

function Values({ val }) {
    return (
        <div className="text-[10px] font-normal text-[#918f8f]">
            {val}
        </div>
    );
}
